import "./Header.css";
import React from "react";

const Header = () =>{

    return(
        <div className="card-header">
            <div className="card-holder-header">
                <div className="details-div-header">
                    <ul className="ul-header">
                        <li>Coin name</li>
                        <li>Current price</li>
                        <li>Change in 24hr</li>
                    </ul>
                </div>    
            </div>
        </div>
    )
}

export default Header;
